import React, { useEffect, useState } from "react";
import icon from "../assets/person-icon-1.png";
import { useNavigate } from 'react-router-dom';

const Profile = () => {
    const [user, setUser] = useState({
        name: "",
        email: "",
        joined: "",
        quizzesCompleted: 0,
        averageScore: "0%",
        questionsAnswered: 0,
    });

    const navigate = useNavigate();
    const [isOpen, setIsOpen] = useState(false);

    const toggleDropdown = () => setIsOpen(!isOpen);

    useEffect(() => {
        const userID = localStorage.getItem("userID");
        console.log("USER ID:",userID);

        const fetchUserInfo = async () => {
            const res = await fetch(`https://localhost:3001/api/user/${userID}`);
            const data = await res.json();
            setUser(prev => ({
                ...prev,
                name: data.username,
                email: data.email,
                joined: new Date(data.joined).toLocaleString("default", { month: "long", year: "numeric" }),
            }));
        };

        const fetchStats = async () => {
            try {
                const res = await fetch(`https://localhost:3001/api/result/attempts/${userID}`);
                const attempts = await res.json();

                const quizzesCompleted = attempts.length;

                let totalScore = 0;
                let totalPossible = 0;
                let totalQuestionsAnswered = 0;

                attempts.forEach(attempt => {
                    totalScore += attempt.score;
                    totalPossible += attempt.totalQuestions;
                    totalQuestionsAnswered += attempt.totalQuestions;
                });

                console.log("Total Score: ", totalScore);

                const averageScore = totalPossible > 0
                    ? `${Math.round((totalScore / totalPossible) * 100)}%`
                    : "0%";

                setUser(prev => ({
                    ...prev,
                    quizzesCompleted,
                    averageScore,
                    questionsAnswered: totalQuestionsAnswered,
                }));
            } catch (err) {
                console.error("Failed to fetch stats:", err);
            }
        };        

        fetchUserInfo();
        fetchStats();
    }, []);

    return (
        <div className="position-relative" style={{ height: "88vh" }}>

          {/* Background split */}
          <div className="d-flex flex-column h-100">
            {/* Black top background */}
            <div className="bg-black" style={{ flex: '0 0 30%' }}></div>

            {/* Gray bottom background */}
            <div className="bg-secondary" style={{ flex: '0 0 70%' }}></div>
          </div>

          {/* Card positioned on top */}
          <div
            className="bg-white rounded-4 shadow-lg p-4 d-flex flex-column align-items-center"
            style={{
                width: '100%',
                maxWidth: '700px',
                position: 'absolute',
                top: '30%',
                left: '50%',
                transform: 'translate(-50%, -25%)',
                textAlign: 'center'
            }}
          >
            {/* Profile Picture */}
            <div style={{ position: 'absolute', top: '-60px', left: '50%', transform: 'translateX(-50%)' }}>
              <img 
                src={icon} 
                alt="Profile" 
                className="rounded-circle" 
                style={{ width: '120px', 
                         height: '120px', 
                         objectFit: 'cover', 
                         border: '5px solid white', 
                         boxShadow: '0 4px 20px rgba(0,0,0,0.2)' }}
              />
            </div>

            {/* Top Buttons */}
            <div className="d-flex justify-content-between mt-5 px-3 w-100">
              <div style={{ color: '#3a7bd5', fontSize: '14px', cursor: 'pointer' }} 
                  onClick={() => navigate('/my-quizzes')} 
              >
                <i className="bi bi-collection" style={{ marginRight: '4px' }}></i> Quizzes
              </div>
              <div style={{ color: '#3a7bd5', fontSize: '14px', cursor: 'pointer' }}
                    onClick={() => navigate('/attempts')}
              >
                <i className="bi bi-award" style={{ marginRight: '4px' }}></i> Attempts
              </div>
            </div>

            {/* User Info */}
            <div className="mt-3">
              <h3 className="fw-bold text-dark mb-1">{user.name}</h3>
              <p className="text-secondary mb-1">{user.email}</p>
              <p className="text-muted" style={{ fontSize: '14px' }}>Joined {user.joined}</p>
            </div>

            {/* Stats */}
            <div className="d-flex justify-content-around my-4 w-100">
              <div>
                <h4 className="fw-bold text-primary mb-0">{user.quizzesCompleted}</h4>
                <small className="text-dark">Quizzes</small>
              </div>
              <div>
                <h4 className="fw-bold text-primary mb-0">{user.averageScore}</h4>
                <small className="text-dark">Avg Score</small>
              </div>
              <div>
                <h4 className="fw-bold text-primary mb-0">{user.questionsAnswered}</h4>
                <small className="text-dark">Questions</small>
              </div>
            </div>

            {/* Show More Button */}
            <div className="mt-4 w-full">
              <div className="relative">
                {/* Main button with improved styling */}
                <button 
                  className="flex items-center justify-center w-full bg-gradient-to-r from-blue-500 to-blue-600 text-white py-3 px-6 rounded-full shadow-lg hover:shadow-xl transition-all duration-300"
                  onClick={toggleDropdown}
                >
                  <span className="font-medium mr-2">Take New Quiz</span>
                  <svg 
                    className={`w-4 h-4 transition-transform duration-300 ${isOpen ? 'rotate-180' : ''}`} 
                    fill="none" 
                    stroke="currentColor" 
                    viewBox="0 0 24 24"
                  >
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M19 9l-7 7-7-7" />
                  </svg>
                </button>

                {/* Dropdown menu with enhanced styling */}
                {isOpen && (
                  <div className="absolute mt-2 w-full bg-white rounded-lg shadow-lg overflow-hidden z-10 transition-all duration-300">
                    <div className="p-1">
                      <button 
                        className="flex items-center w-full p-3 text-left hover:bg-blue-50 rounded-md transition-colors duration-200"
                        onClick={() => {
                          navigate('/quiz/ai');
                          setIsOpen(false);
                        }}
                      >
                        <div className="bg-blue-100 p-2 rounded-full mr-3">
                          <svg className="w-5 h-5 text-blue-600" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M9.663 17h4.673M12 3v1m6.364 1.636l-.707.707M21 12h-1M4 12H3m3.343-5.657l-.707-.707m2.828 9.9a5 5 0 117.072 0l-.548.547A3.374 3.374 0 0014 18.469V19a2 2 0 11-4 0v-.531c0-.895-.356-1.754-.988-2.386l-.548-.547z" />
                          </svg>
                        </div>
                        <div>
                          <p className="font-medium text-gray-800">AI Quiz</p>
                          <p className="text-sm text-gray-500">Test your knowledge about AI</p>
                        </div>
                      </button>

                      <button 
                        className="flex items-center w-full p-3 text-left hover:bg-blue-50 rounded-md transition-colors duration-200"
                        onClick={() => {
                          navigate('/quiz/trivia');
                          setIsOpen(false);
                        }}
                      >
                        <div className="bg-blue-100 p-2 rounded-full mr-3">
                          <svg className="w-5 h-5 text-blue-600" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M8.228 9c.549-1.165 2.03-2 3.772-2 2.21 0 4 1.343 4 3 0 1.4-1.278 2.575-3.006 2.907-.542.104-.994.54-.994 1.093m0 3h.01M21 12a9 9 0 11-18 0 9 9 0 0118 0z" />
                          </svg>
                        </div>
                        <div>
                          <p className="font-medium text-gray-800">Trivia Quiz</p>
                          <p className="text-sm text-gray-500">Fun general knowledge questions</p>
                        </div>
                      </button>
                    </div>
                  </div>
                )}
              </div>
            </div>
          </div>
        </div>
    );
};

export default Profile;
